import React from 'react';
import {
    Card, CardImg, CardBody,
    CardTitle
  } from 'reactstrap';

  const PlayerCard = (props) => {

    return (
      <div>
        <Card>
          <CardImg style={{width: '150px', height: '150px'}} src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTWRmi9BgjuxNemi_dU_uXYP6wMngvuo3gxtQ&usqp=CAU" alt="Card image cap" />
          <CardBody>
            <CardTitle>Callum Hudson Odoi</CardTitle>
          </CardBody>
        </Card>
      </div>
    );
  };

  export default PlayerCard;
